import { useLocation, useRouteMatch } from "react-router-dom";

const AnaSayfaB = (props) => {
  const routeMatch = useRouteMatch();
  const { userId } = routeMatch.params;

  return (
    <div>
      <h1>AnaSayfaB: {userId}</h1>
    </div>
  );
};

module.exports = { AnaSayfaB };
